import './collection-item.styles.scss';

const CollectionItem = ({name, imageUrl, price, id}) => {
    return (<div className='collection-item'>
        <div className='image' style={{backgroundImage: `url(${imageUrl})`}} >

        </div>
    </div>)
};

export default CollectionItem;
